import React from 'react';
import './Button.css'
import { Container, Row, Col } from 'react-bootstrap';

const Button = ({num}) => {
  return (
    <Container>
      <Row className="justify-content-center">
        <Col xs={8} lg={6} style={{ width: "15rem", height: "15rem" }}>
          <Col className="h-100 mt-4 rounded-circle bigButton">
            <Row className="py-3">
              <Col xs={3}>{num}</Col>
            </Row>
          </Col>

        </Col>
      </Row>
    </Container>
  );
}

export default Button;
